    def disabled(self, Form):
        if len(self.pass_input.text())> 0 and len(self.user_input.text())> 0 and len(self.confirm_pass.text())> 0:
            self.enter_button.setDisabled(False)
        else:
            self.enter_button.setDisabled(True)
    def add(self, Form):
        if self.pass_input.text() != self.confirm_pass.text():
            msg = QMessageBox() 
            msg.setIcon(QMessageBox.Information)  
            msg.setText("Passwords do not match")  
            msg.setWindowTitle("Error")  

            retval = msg.exec_()
        else:
            lst = []
            s = self.user_input + "," + self.pass_input + '\n'
            lst.append(s)
            with open("users.csv", "a") as file:
                file.writelines(lst)
            msg = QMessageBox() 
            msg.setIcon(QMessageBox.Information)  
            msg.setText("Account Created")  
            msg.setWindowTitle("Success")

